import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppComponent } from './app.component';
import { NavComponent } from './nav/nav.component';
import { DetailsComponent } from './details/details.component';
import { CookingCardComponent } from './cooking-card/cooking-card.component';
import { FooterComponent } from './footer/footer.component';
import { BuyingComponent } from './buying/buying.component';
import { MainFilterComponent } from './main-filter/main-filter.component';
import { AuthorizationComponent } from './authorization/authorization.component';
import { AppRoutingModule } from './app-routing.module';
import { PartnersComponent } from './partners/partners.component';
import { AboutComponent } from './about/about.component';
import { UserCookingsComponent } from './user-cookings/user-cookings.component';

@NgModule({
  declarations: [										
    AppComponent,
      NavComponent,
      DetailsComponent,
      CookingCardComponent,
      FooterComponent,
      BuyingComponent,
      MainFilterComponent,
      AuthorizationComponent,
      PartnersComponent,
      AboutComponent,
      UserCookingsComponent
   ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
